@taqueria_el_poblano – not to be confused with Tacos Los Poblanos – has been killin’ it in South LA for as long as we can remember and their signature besides the owner’s hilarious skit-filled IG account is the delicious dollops of guacamole that accompany each taco or vampiro! This time went with four carne asada tacos and one carne asada vampiro because Poblanos asada is king! They have other meats, though, and you’re sure to enjoy the whole street atmosphere backdrop. Like, comment or tag a friend who should take you here!! ✌️😎🌮 #LAFoodieGuy #LAFG 
