XXL Bangin’ Fries || Bangin’ Buns (@banginbuns) || Artesia, CA

Video Credit 🎥: @lafoodieguy 

@banginbuns started off as a humble hot chicken stand in NoHo three years ago and now they’re ready to open up their third brick and mortar in Artesia!!📍The buns are delicious but another go-to is the regular-sized version of the above Bangin’ Fries. The Grand Opening is THIS WEDNESDAY September, 8th from 6-10PM‼️ Everyone who purchases a meal in Artesia that night will get a raffle ticket for the PS5 Giveaway. The first 25 people in line Wednesday will get a FREE meal from Bangin’ and a Free House Coffee from 7 Leaves Cafe next door. ☕️ They’ll also be giving out Bangin’ Buns merch until they run out AND everyone gets 20% off that day!!! Will you be there?! Like, comment or tag a friend who could finish all of these fries! ✌️😎🍟🐔 #LAFoodieGuy #LAFG #Artesia
